import React, { Component } from 'react'
import Container from 'react-bootstrap/Container'
import TeamServices from '../../../services/team.services'
import './match.css'
import UserCard from '../user/UserCard'

import { Radar, RadarChart, PolarGrid, PolarAngleAxis } from "recharts";
import Select from '../../ui/Select'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
import Button from 'react-bootstrap/Button'


class Match extends Component {


    constructor(props) {
        super(props)
        this.state = { team: {}, select_1: null, select_2: null, selectedTeam: null }
        this.services = new TeamServices()
    }

    componentDidMount = () => this.getAllTeam()

    getAllTeam = () => {
        this.services.getAllTeam()
            .then(allteam => this.setState({ team: allteam }))
            .catch(err => console.log(err))
    }

    getMyTeam = () => {
        this.services.getMyTeam()
            .then(theTeam => this.setState({ team: theTeam }))
            .catch(err => console.log(err))
    }

    membersteam = (teamName, value) => {
        console.log(value)
        console.log(teamName) //value del input/nombre del equipo
        const selector = value//name del input/el imput que lo ha marcado
        this.setState({ [selector]: teamName }, () => {

            // filtrar los equipos con los valores
            if (this.state.select_1 != null && this.state.select_2 != null) {
                //nos copiamos el team completo del state
                const result = this.state.team.filter(team => {
                    return team.name === this.state.select_1 || team.name === this.state.select_2
                })
                // return result
                //filtramos los que coincidan con los select
                //metemos en selectedTeam el array que retorna filter
                this.setState({ selectedTeam: result });
            }
        })
    }

    num = () => {
        Math.floor((Math.random() * (11 - 5)) + 5);
    }
    chart = () => {
        const teamData = [Object.entries(team.members.data).map(e => ({
            name: e[0],
            value: e[1],
            fullMark: 20
        }))];
        const teamDataReducido = teamData.reduce((acumulado, elemento) => {
            acumulado.this.state.team.members.data.kills += elemento.team.members.data.kills
            acumulado.team.members.data.deaths += elemento.team.members.data.deaths
            acumulado.team.members.data.assists += elemento.team.members.data.assists

            return acumulado
        },
            { points: 0, height: 0 })
        teamDataReducido.team.members.data.kills = teamDataReducido.team.members.data.kills / team.members.length
        teamDataReducido.team.members.data.deaths = teamDataReducido.team.members.deaths / team.members.length
        teamDataReducido.team.members.data.assists = teamDataReducido.team.members.data.assists / team.members.length

    }


    render() {
        console.log()
        return (
            <Container>
                <Row>
                    <Col><h3 className="h3-style">Selecciona tu equipo</h3>
                        <Select name="select_1" teams={this.state.team} setMembers={this.membersteam} />
                    </Col>
                    <Col><h3>Selecciona el equipo del contrincante</h3>
                        <Select name="select_2" teams={this.state.team} setMembers={this.membersteam} />
                    </Col>
                </Row>
                <Row>

                    {this.state.selectedTeam && this.state.selectedTeam.map(team => {

                        return <Col>
                            {team.members.map(elm => <UserCard key={elm._id} {...elm} />)}
                        </Col>
                    })
                    }
                </Row>
                {/* pintar aqui chart */}
                <RadarChart
                    cx={600}
                    cy={500}
                    outerRadius={300}
                    width={1000}
                    height={800}
                    data={teamDataReducido}
                >
                    <PolarGrid />
                    <PolarAngleAxis dataKey="name" />
                    <Radar
                        name="Mike"
                        dataKey="value"
                        stroke="#7784d8"
                        fill="#8884d8"
                        fillOpacity={0.6}
                    />
                </RadarChart>
                <Row>
                    <Col>
                        <Button className="button-style" onClick={this.num}> Generar c√≥digo de partida</Button>
                    </Col>
                </Row>
            </Container >
        )
    }
}







export default Match


